drop table if exists stop;
create table stop (
    id INTEGER,
    name TEXT,
    description TEXT,
    lat FLOAT,
    lon FLOAT,
    url TEXT,
    location_type INTEGER,
    parent_station INTEGER,
    PRIMARY KEY(id));




-- train

drop table if exists route;
create table route (id INTEGER, short_name TEXT, long_name TEXT, description TEXT, type INTEGER,
PRIMARY KEY(id));


-- trains


drop table if exists block;
create table block (
     id INTEGER,
     name TEXT,
     display_order INTEGER,
     PRIMARY KEY(id)
);


drop table if exists stop_block;
create table stop_block (
    block_id INTEGER,
    stop_id INTEGER,
    PRIMARY KEY(stop_id, block_id));


-- train

drop table if exists stop_time;
create table stop_time (
trip_id INTEGER,
arrival_time TEXT,
departure_time TEXT,
stop_id INTEGER,
stop_sequence INTEGER,
pickup_type INTEGER,
drop_off_type INTEGER
);



























































-- train















drop table if exists transfer;
create table transfer (
from_stop_id INTEGER,
to_stop_id INTEGER,
transfer_type INTEGER,
min_transfer_time INTEGER,
PRIMARY KEY(from_stop_id, to_stop_id)
);



