drop table if exists version;
create table version (
     id INTEGER,
     releaseDate TEXT,
     description TEXT,
     PRIMARY KEY(id)
);

drop table if exists area_metadata;
create table area_metadata (
     area_id INTEGER,
     name TEXT,   -- metadata key.  e.g. lifts, areasOfInterest,...
     json_value TEXT,  -- JSON encoded array of strings
     PRIMARY KEY(area_id, name)
);


drop table if exists stop_metadata;
create table stop_metadata (
     stop_id INTEGER,
     name TEXT,    -- metadata key
     json_value TEXT,  -- value
     PRIMARY KEY(stop_id, name)
);





drop table if exists service;
create table service (
     id INTEGER,
     route_id INTEGER,
     description TEXT,
     from_date TEXT,
     to_date TEXT,
     json_days TEXT,
     holidays INT,
     PRIMARY KEY(id)
);




drop table if exists trip;
create table trip (
route_id INTEGER,
service_id INTEGER,
id INTEGER,
headsign TEXT,
block_id INTEGER,
PRIMARY KEY(id)
);

